"Uz vaše dopuštenje OnePlus će prikupljati podatke o upotrebi telefona kako bi poboljšao dizajn proizvoda i korisničko iskustvo. Ako se složite na pridruživanje Programu korisničkog iskustva (“Program”), to potvrđuje da se slažete da OnePlus može prikupljati, upotrebljavati i analizirati sljedeće podatke: 
 (1) Konfiguracijske podatke;
 (2) Statističke podatke aplikacije;
 (3) Podatke o korisničkom ponašanju;
 Prikupljanjem i analizom gore navedenih podataka OnePlus želi poboljšati korisničko iskustvo. Postupak se izvodi u anonimnom i šifriranom obliku, npr. kroz poboljšanje učinkovitosti baterije i stabilnosti sustava. Ti se podaci neće upotrebljavati za prepoznavanje identiteta osobe. Kada se pridružite Programu, u svakom se trenutku možete odjaviti na sljedeći način: Postavke – Napredno – Program korisničkog iskustva te poništavanjem oznake u okviru. Pogledajte Pravilnik o zaštiti privatnosti tvrtke OnePlus za više informacija o obradi podataka u tvrtki OnePlus. Kada se odjavite iz programa, OnePlus će prestati prikupljati gore navedene podatke."
